import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './Components/Login';
import VerifyOtp from './Components/VerifyOtp';
import Signup from './Components/Signup';
import Profile from './Components/Profile';
import ProtectedRoute from './Components/ProtectedRoute';
// import Home from './Components/Home';
import Home from './Pages/Home';
import PersonalProfile from './Pages/PersonalProfile';
import TaskCard from './Components/ProductCard';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Login} />
        <Route path="/verify-otp" component={VerifyOtp} />
        <Route path="/register" component={Signup} />
        <ProtectedRoute path="/profile/:user_id" component={Profile} />
        <ProtectedRoute path="/me/" component={ProtectedRoute} />
        <ProtectedRoute path="/home" component={Home} />
        <ProtectedRoute path="/home/men/:taskId" component={TaskCard} />
        <ProtectedRoute path="/home/women/:taskId" component={TaskCard} />
        <ProtectedRoute path="/home//:taskId" component={TaskCard} />
        <ProtectedRoute path="/myprofile" component={PersonalProfile} />
      </Switch>
    </Router>
  );
}

export default App;
